import React, { useContext } from 'react';
import { AuthContext } from '../AuthContext'; // 假设你的 AuthContext 导出了用户角色信息

function Home() {
    const { userRole } = useContext(AuthContext); // 从上下文中获取用户角色信息

    // 根据用户角色进行条件渲染
    return (
        <div>
            {userRole === 'admin' ? (
                <h2>Hi admin</h2>
            ) : (
                <h2>Hi customer</h2>
            )}
            <p>Welcome to the Home page!</p>
        </div>
    );
}

export default Home;
